    "genre": "goldfish",
    "title": "Sugar Man by Rodriguez (The Goldfish Remix)",
    "description": "GOLDFISH STREAM TRIBUTE TO UNSUNG US HERO RODRIGUEZ ‚Ä?SUGAR MAN‚Äô (GOLDFISH REMIX)\n\n[Download the ORIGINAL here: http://smarturl.it/rodriguezitunes ]\n\nThanks to the 2012 Oscar-winning documentary ‚Ä?Searching For Sugarman‚Äô, the incredible tale of American recording artist Sixto ‚Ä?Jes√∫s‚Äô Rodriguez has been heard by millions of music fans worldwide.\n\nUnheard of, forgotten, virtually ignored in the US, Rodriguez was revered and idolized in South Africa, where his censored ‚Ä?Cold Fact‚Äô album became a political touchstone for thousands of South Africans fed up of apartheid and racial inequality in their country. \n\nWATCH GOLDFISH LIVE‚ÄôS ADE SPECIAL WITH BAKERMAT ON BE AT TV\n\nThemselves one of the most successful recording artists in South African history, live electronic band and MTV winners Goldfish have chosen to celebrate Rodriguez‚Äô work ahead of their US tour by remixing ‚Ä?Sugar Man‚Äô from ‚Ä?Cold Fact‚Äô. \n\nThe pair‚Äôs reworking is as sensitive to the original subject as it is beautiful. For those fearing an EDM revamping, nothing could be further from the truth. The deep, dreamy remix is testament not only to Goldfish‚Äôs high-end production and composition skills, but also their close affinity to and understanding of the track. The hazy, heady, almost hallucinogenic spirit of Rodriguez‚Äô ‚Ä?Sugar Man‚Äô is still very much intact, in parts stripped down to a few lush piano chords, other times sweeping the listener up in a warm envelope of sound and emotion, Rodriguez‚Äô haunting vocals guiding the single the entire time.\n\nDave Poole and Dominic Peters, who fly out to Rodriguez‚Äô home country after their sold out ADE Special with Bakermat this Thursday, (available to view live on Be At TV here) spoke about why they decided to pay tribute to one of South Africa‚Äôs highest grossing artists.\n\n‚ÄúGoing over to America as South Africans, it made sense to highlight the biggest connection for us between the two countries.‚Äù Poole said. ‚ÄúFor any South African, Rodriguez is as legendary as they come and we all grew up knowing his music. He‚Äôs an icon.‚Äù\n\nFor decades, South African fans thought the folk singer had committed suicide. Wild rumours circulated varying from him shooting his brains out on stage, to setting himself on fire in front of a horrified audience. The truth, it turned out, was that the man ‚Ä?Cold Fact‚Äô co-producer Mike Theodore deemed ‚Äúbetter than Dylan‚Äù was working as a construction worker in Detroit. A curious and enigmatic figure, he had absolutely no idea of the impact or commercial success he‚Äôd enjoyed thousands of miles away on another continent. \n\n‚ÄúIt‚Äôs kind of crazy thinking about just how influential Rodriguez has been on generations of South Africans ‚Äì including us,‚Äù Peters said, ‚Äúand he never knew a thing about it. For us there was no better way to show our love and appreciation for a man that really was only about the music, than to put our twist on one of his greatest tracks. We hope people enjoy it and we hope that it introduces his music to a whole new audience in the process.‚Äù\n\nFor more information on Goldfish and to find out how to buy tickets to dates across the tour, visit www.GoldfishLive.com\n[Mixed by www.facebook.com/MixedbyNikodemMilewski]\n",
